@balvino @deanbphillips Cory Booker: "Kavanaugh has been given numerous opportunities to call for an FBI investigation to clear his name .. but he won't." 

19 times. Kavanaugh was asked at least 19 times yesterday to commit to calling for an FBI investigation. He refused every single time. 

19 TIMES.

@balvino @deanbphillips There is already one investigation ongoing and Ellison has now called for another.
So where was Kavanaugh on that investigation? Yeah, right.
We know who the real hypocrite is, and it's not Dean.
